
export{Deployments}
import{List}from'./list/list.min.js'
import{Form}from'./form/form.min.js'
class Deployments{static api='/api/deployment-manager/deployments';static r_api='/api/protocol-adapter-registry/protocol-adapters';constructor(ctr){this.list=new List(ctr);this.form=new Form(ctr);}
draw(sp,{pa}){if(!sp&&!pa){return this.list.draw();}
if(sp&&!pa&&sp.has('action')&&sp.has('id')&&sp.get('action')==='new'){return this.form.draw(sp.get('id'));}}}